import React from "react"
import {Navbar} from "react-bootstrap";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import "../static/styles/navigation.css"
import logo from '../static/img/ibw_nav.png';
import {faFacebookSquare} from "@fortawesome/free-brands-svg-icons";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";


export const Navigation = () =>{
    return (
        <Navbar className={"nav-color"} expand={"lg"} variant={"light"} fixed="top">
            <Navbar.Brand href="/home">
                <img
                    src={logo}
                    className="d-inline-block align-top"
                    alt="iBathwater logo"
                />
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav"/>
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="/about">
                        <FontAwesomeIcon icon={faFacebookSquare} size={'1x'} color={"#007bff"} ></FontAwesomeIcon>
                        &nbsp;About
                    </Nav.Link>
                    <NavDropdown title="Datasets" id="basic-nav-dropdown">
                        <Nav.Link href="/datasets">List</Nav.Link>
                        <Nav.Link href="/new">New</Nav.Link>
                    </NavDropdown>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}
